import React from 'react';



const link1 =  "https://cdn-icons-png.flaticon.com/512/725/725289.png"
const link2 =  "https://cdn-icons-png.flaticon.com/512/1384/1384063.png"
const link3 =  "https://cdn-icons-png.flaticon.com/512/1077/1077042.png"
const link4 =  "https://cdn-icons-png.flaticon.com/512/1322/1322053.png"





export default function Footer(){
    return(
        <div className="footer">
            <img src={link1} alt="h"></img>
            <img src={link2} alt="h"></img>
            <img src={link3} alt="h"></img>
            <img src={link4} alt="h"></img>
 
        </div>

    )

}
